CREATE TABLE "courses_course" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(200) NOT NULL, "slug" varchar(200) NOT NULL UNIQUE, "overview" text NOT NULL, "created" datetime NOT NULL, "owner_id" integer NOT NULL REFERENCES "auth_user" ("id"), "subject_id" integer NOT NULL REFERENCES "courses_subject" ("id"));
CREATE TABLE "courses_file" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(250) NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "file" varchar(100) NOT NULL, "owner_id" integer NOT NULL REFERENCES "auth_user" ("id"));
CREATE TABLE "courses_image" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(250) NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "file" varchar(100) NOT NULL, "owner_id" integer NOT NULL REFERENCES "auth_user" ("id"));
CREATE TABLE "courses_text" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(250) NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "content" text NOT NULL, "owner_id" integer NOT NULL REFERENCES "auth_user" ("id"));
CREATE TABLE "courses_content" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" integer unsigned NOT NULL, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "module_id" integer NOT NULL REFERENCES "courses_module" ("id"), "order" integer unsigned NOT NULL);
CREATE TABLE "courses_module" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(200) NOT NULL, "description" text NOT NULL, "course_id" integer NOT NULL REFERENCES "courses_course" ("id"), "order" integer unsigned NOT NULL);
CREATE TABLE "courses_course_students" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "course_id" integer NOT NULL REFERENCES "courses_course" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"));
